import React from 'react';
import './App.css';
import { NotesList } from './components/NotesList';
import 'antd/dist/antd.css';
import NoteFrom from './components/NoteFrom';
import { Typography} from 'antd';
const { Text } = Typography;

function App() {
  return (
    <di>
      <div style={{marginLeft:'20px',padding:'20px 20px 10px 20px' ,backgroundColor:'#5464fe' ,width:'340px'}}>
        <Text strong style={{color:'#fff' , fontSize : '20px'}}>Note App</Text>
      </div>
      <div style={{margin :'0px 20px' ,padding:'20px', backgroundColor:'#f4f6f8' ,width:'340px'}}>
        <NoteFrom></NoteFrom>
        <NotesList></NotesList>
      </div>
    </di>
  );
}

export default App;
